import React from "react";

function Navbar() {
  return (
    <nav className="nav">
      <div>
        <h1>Software Mind</h1>
        <h3>About Us</h3>
        <h3>Offer</h3>
        <h3>Case studies</h3>
      </div>
      <div>
        <h3>Careers</h3>
        <h3>Blog</h3>
        <h3>Contact</h3>
      </div>
    </nav>
  );
}

export default Navbar;
